-- Intended to be run to populate a database with tables and mock data.
-- Note that this script will wipe out any existing setup when run.

-- Drop existing tables to wipe the slate clean.
-- Will throw (ignorable) errors if the tables don't exist.
DROP TABLE rosters;
DROP TABLE players;
DROP TABLE eventTeams;
DROP TABLE teams;
DROP TABLE events;

-- Create tables
CREATE TABLE events (
    event_id INT NOT NULL,
    remote_id varchar(10) NOT NULL,
    url varchar(100) NOT NULL,
    name varchar(50) NOT NULL,
    startDate TIMESTAMP NOT NULL,
    teamCount INT NOT NULL,
    PRIMARY KEY (event_id)
);

CREATE TABLE teams (
    team_id INT NOT NULL,
    remote_id varchar(30) NOT NULL,
    url varchar(100),
    PRIMARY KEY (team_id)
);

CREATE TABLE eventTeams (
    event_id INT NOT NULL,
    team_id INT NOT NULL,
    name varchar(50) NOT NULL,
    verification_status INT NOT NULL CHECK (verification_status between 0 and 4),
    verification_note varchar(1000),
    dropped INT NOT NULL CHECK (dropped between 0 and 1),
    reg_order INT NOT NULL,
    PRIMARY KEY (event_id, team_id),
    FOREIGN KEY (event_id) REFERENCES events (event_id),
    FOREIGN KEY (team_id) REFERENCES teams (team_id)
);

CREATE TABLE players (
    player_id INT NOT NULL,
    remote_id varchar(10) NOT NULL,
    url varchar(100),
    PRIMARY KEY (player_id)
);

CREATE TABLE rosters (
    event_id INT NOT NULL,
    team_id INT NOT NULL,
    player_id INT NOT NULL,
    name varchar(50) NOT NULL,
    verification_status INT NOT NULL CHECK (verification_status between 0 and 4),
    verification_note varchar(1000),
    dropped INT NOT NULL CHECK (dropped between 0 and 1),
    PRIMARY KEY (event_id, team_id, player_id),
    FOREIGN KEY (event_id) REFERENCES events (event_id),
    FOREIGN KEY (team_id) REFERENCES teams (team_id),
    FOREIGN KEY (player_id) REFERENCES players (player_id)
);

